r area of Whitechapel. \r   Situated in this private development, the apartment comprises of an open-plan living space with a fully fitted modern kitchen together all mod cons, 2 well propotioned double bedrooms, both with double beds and wardrobes and a good sized bathroom with shower over bath. Offering a modern neutral decor throughout, wood floors, gas central heating and coming furnished to an excellent standard, this apartment is ideal for the city professional. \r   The accommodation is set within a residential setting with swift links to the City and Docklands.\r   The closest underground stations are Whitechapel (District, Hammersmith & City and East London lines) and Shadwell (East London line and Docklands Light Railway). While for motorists there is easy access to the A13 for routes out of London to the East.\r   Contact Net Lettings now on 020 8981 5551 to arrange a viewing.',1733,400,51.5141,-0.061356,0,1,0,'Long term','Furnished','2016-06-14 00:00:00','2016-05-25 00:00:00','2016-05-27 16:56:05','2016-06-04 02:16:29',1,20,'modern bedroom apart locat highli sought area whitechapel situat privat develop apart compris open plan live space fulli fit modern kitchen togeth mod con well propot doubl bedroom doubl bed wardrob good size bathroom shower bath offer modern neutral decor throughout wood floor ga central heat come furnish excel standard apart ideal citi profession accommod set within residenti set swift link citi dockland closest underground station whitechapel district hammersmith citi east london line shadwel east london line dockland light railway motorist easi access rout london east contact net let arrang view',91,0.523809,0.295775,16,5,0.0223989,0.424124,0.0199797,0.122959,0.410539,0.82189,2,NULL,0),(27362249,569,'http://www.rightmove.co.uk/property-to-rent/property-27362249.html','2 bedroom apartment to rent','In the popular development of Trinity Mead this two double bedroom ground floor apartment offers good size modern spacious accommodati