ht.   The area offers an array of restaurants and pubs, some offering live music at the weekends, and a wide selection of coffee shops both large names and smaller independent cafes. For the weekly shop there is a large Sainsburys at Tooting Broadway and when theres a need for something more specialist, a variety of independent food retailers can be found in the town.  There are High Street names, as well as one-off independent boutiques for those little things you just wont find anywhere else.  There are a number of nurseries, primary schools, secondary schools and sixth forms in the area, so if you have children you can rest assured that their education is taken care of, whatever their age.  Doctors and dental surgeries can be found in the town, with the nearest large hospital being St. Georges, meaning healthcare is another important part of life you dont have to worry about. Gateside Road is located in Zone 3 and getting out and about is easy, with the town being well served by buses, trains and the underground. Tooting Bec underground station is on the Northern Line and overground trains from Balham station operate to Victoria.   Tooting has seen a lot of changes over recent years, it still maintains its character and a number of older listed buildings in the town. From banks to beauty salons and Sainsburys to Starbucks, Tooting has become a destination in its own right, but when you do need to head into the City or the West End, it couldnt be easier by train or tube. A wonderful, newly redecorated three double bedroom house in a small gated development. Offering three bathrooms, two en-suite, an eat in Kitchen with doors opening on to the rear garden, a separate reception room, a guest W.C. and a garage this property would suit a family or professional sharers.',2817,650,51.4368,-0.166928,0,0,0,'Long term','Furnished or unfurnished, landlord is flexible','2016-05-27 00:00:00','2016-05-24 00:00:00','2016-05-26 08:39:45','2016-05-26 08:39:45',1,3,'wonder newli r